theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:80px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #f92733;}
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* sticky-header-color 
=========================*/
.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section { background-color:#FFFFFF !important; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky .elementor-section-wrap > .elementor-section > .elementor-container { height:80px; }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class .wp_ulike_btn:before { font-size:10px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* product-single-wishlist-button-icon-size 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon::before { font-size:18px; }
/* product-single-share-button-icon-size 
=========================*/
.single-product .aux-share-btn span::before { font-size:20px; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* product-title-bar-overlay-pattern-opacity 
=========================*/
.single-product .aux-overlay-bg-hash::before { opacity:0.5; }
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #1162fd;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #70798b;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: #000000;}
/* body-typography 
=========================*/
body{ font-family:'Montserrat'; } 
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Poppins'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Poppins'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Poppins'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Poppins'; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Poppins'; } 
/* product-setting-section-shop-page-product-title-typo 
=========================*/
.aux-shop-archive .products-loop .auxshp-loop-title{ color:rgb(0, 0, 0); font-size:16px; font-weight:500; line-height:1.4em; } 
/* product-setting-section-shop-page-product-price-typo 
=========================*/
.aux-shop-archive .products-loop .price .amount, .aux-shop-archive .products-loop .price ins .amount{ font-family:'Montserrat'; color:rgb(0, 0, 0); font-size:20px; font-weight:bold; line-height:1.3em; } 
/* product-setting-section-shop-page-product-reg-price-typo 
=========================*/
.aux-shop-archive .products-loop .price del,  .aux-shop-archive .products-loop .price del .amount{ color:rgb(130, 130, 130); font-size:15px; font-weight:500; line-height:1.4em; } 
/* product-setting-section-shop-page-result-typo 
=========================*/
.woocommerce-page .woocommerce-result-count{ font-family:'Poppins'; font-size:30px; font-weight:bold; letter-spacing:-0.6px; line-height:1.4em; color:rgb(32, 36, 46); } 
/* sidebar-common-widget-title-typography 
=========================*/
.aux-sidebar .widget-title{ font-family:'Poppins'; color:rgb(0, 0, 0); font-size:20px; font-weight:bold; text-transform:capitalize; line-height:1.4em; } 
/* sidebar-global-typography 
=========================*/
.aux-sidebar{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; text-decoration:none; letter-spacing:-0.32px; } 
/* sidebar-primary-widget-title-typography 
=========================*/
.aux-sidebar-primary .widget-title{ letter-spacing:-1px; } 
/* product-setting-section-shop-page-sales-badge-typo 
=========================*/
.aux-shop-archive .products-loop .onsale{ color:rgb(255, 255, 255); font-size:12px; font-weight:bold; line-height:24px; } 
/* product-setting-section-single-appearance-title 
=========================*/
.single-product .entry-title{ color:rgb(0, 0, 0); font-size:30px; font-weight:bold; line-height:1.4em; letter-spacing:-0.6px; } 
@media(max-width: 1024px){ .single-product .entry-title{ font-size:25px; }  } 
/* product-setting-section-single-appearance-price 
=========================*/
.single-product .price .amount, .single-product .price ins .amount{ color:rgb(0, 0, 0); font-size:25px; font-weight:bold; line-height:1.3em; letter-spacing:-0.75px; } 
@media(max-width: 1024px){ .single-product .price .amount, .single-product .price ins .amount{ font-size:20px; }  } 
/* product-setting-section-single-appearance-reg-price 
=========================*/
.single-product .price del .amount, .single-product .price del{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; line-height:1.4em; letter-spacing:-0.48px; } 
@media(max-width: 1024px){ .single-product .price del .amount, .single-product .price del{ font-size:14px; }  } 
/* product-setting-section-single-appearance-star-text 
=========================*/
.single-product .woocommerce-review-link{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; line-height:1.4em; } 
/* product-setting-section-single-appearance-description 
=========================*/
.single-product .woocommerce-product-details__short-description{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; letter-spacing:-0.48px; line-height:1.4em; } 
@media(max-width: 1024px){ .single-product .woocommerce-product-details__short-description{ font-size:13px; }  } 
/* product-setting-section-single-appearance-add-to-btn 
=========================*/
.single-product .cart .auxshp-add-to-cart{ color:rgb(255, 255, 255); font-size:15px; font-weight:500; text-transform:capitalize; line-height:1.4em; letter-spacing:-0.3px; } 
@media(max-width: 1024px){ .single-product .cart .auxshp-add-to-cart{ font-size:13px; }  } 
/* product-setting-section-single-appearance-category 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-label{ color:rgb(0, 0, 0); font-size:16px; font-weight:600; line-height:1.4em; letter-spacing:-0.48px; } 
/* product-setting-section-single-appearance-category-terms 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-meta-terms, .single-product .auxshp-cats-wrapper .auxshp-meta-terms a{ color:rgb(133, 137, 151); font-size:16px; font-weight:500; line-height:1.4em; } 
/* product-single-wishlist-button-margin 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon{ margin: 0px 0px 0px 27px !important } 
/* product-single-share-button-margin 
=========================*/
.single-product .aux-share-btn .aux-icon{ margin: 0px 0px 0px 10px } 
/* product-setting-section-single-appearance-review-content 
=========================*/
.single-product .woocommerce-Reviews .comment-text{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; line-height:1.5em; } 
/* product-setting-section-single-appearance-review-date 
=========================*/
.single-product .woocommerce-review__published-date{ color:rgb(112, 121, 139); font-size:15px; font-weight:500; line-height:1.4em; } 
/* product-setting-section-single-appearance-review-replay-title 
=========================*/
.single-product .woocommerce-Reviews .comment-reply-title{ color:rgb(30, 30, 30); font-size:30px; font-weight:bold; text-transform:capitalize; line-height:1.4em; letter-spacing:-0.9px; } 
/* product-setting-section-single-appearance-review-author 
=========================*/
.single-product .woocommerce-review__author{ color:rgb(0, 0, 0); font-size:20px; font-weight:bold; line-height:1.2em; } 
/* comment-forms-button-typo 
=========================*/
#commentform .form-submit input[type="submit"]{ color:rgb(255, 255, 255); font-size:16px; font-weight:500; text-transform:capitalize; line-height:1.4em; } 
/* product-setting-section-single-appearance-tabs-title 
=========================*/
.woocommerce-page .woocommerce-tabs .tabs li a{ color:rgb(112, 121, 139); font-size:16px; font-weight:500; line-height:1.4em; } 
@media(max-width: 1024px){ .woocommerce-page .woocommerce-tabs .tabs li a{ font-size:15px; }  }

